					TipoDistribuidorPeer::addInstanceToPool($obj4, $key4);
				} // if $obj4 already loaded

				// Add the $obj1 (ExpositorFeria) to the collection in $obj4 (TipoDistribuidor)
				$obj4->addExpositorFeria($obj1);

			} // if joined row is not null

				// Add objects for joined Stand rows

				$key5 = StandPeer::getPrimaryKeyHashFromRow($row, $startcol5);
				if ($key5 !== null) {
					$obj5 = StandPeer::getInstanceFromPool($key5);
					if (!$obj5) {
	
						$cls = StandPeer::getOMClass(false);

					$obj5 = new $cls();
					$obj5->hydrate($row, $startcol5);
					StandPeer::addInstanceToPool($obj5, $key5);
				} // if $obj5 already loaded

				// Add the $obj1 (ExpositorFeria) to the collection in $obj5 (Stand)
				$obj5->addExpositorFeria($obj1);

			} // if joined row is not null

			$results[] = $obj1;
		}
		$stmt->closeCursor();
		return $results;
	}

